@everyone **Alright guys lets have our very first community competition**

Cabinets in Indonesia are all about strengthening the presidential power instead of any functional duty. Atleast in Europe, Cabinet membership is usually given to members of the party or coalition that are most qualified. In Indonesia, **OUR CABINET IS A GIVEAWAY!**. We have a football Dream Team, so I want you guys to make your own **Dream Cabinet**!

Post who you think should go on the Cabinet of Indonesia, anyone is fair game. You want to put Ria Ricis? Ferry Irwandi? Raffathar? Ronald Sinaga? Bobby Saputra? Najwa Shihab? Isyana Saraswati? **GO AHEAD**. Post your **Dream Cabinet** in #âŠ±ãƒ»ğŸ’¡ãƒ»suggestions using the following template down below, and winner will receive a **300k Rupiah worth of Gopay**!!

@everyone It's official guys, ***DONALD TRUMP HAS WON THE PRESIDENTIAL ELECTION***

Surely this will signal an America more involved with inward problems and will definitely redefine once again America's relationship with Indonesia into something more uncertain but definitely more transactional. A stronger and happy America is what we need but RIP to Ukraine and Palestine. RIP to Taiwan. I think this is for the best, but appeasement is never the option (as we learn so from history) so we expect Trump to have an even stronger but fairer foreign policy against Russia and China. But this will definitely be a good four years.

What are your thoughts?

