@everyone Tomorrow at 10pm I will host another BIMTEK, and the topic will be about **Authoritarianism in Indonesia**

This Bimtek will be special. It will be a fireside chat. **Instead of me presenting my thoughts or takes or technical understanding of Indonesia's political dynamics, I will have you guys come into the stage and answer questions instead**. Depending on the perspective and opinion, it could be a discussion or a debate.

Bear in mind this discussion is not to endorse authoritarianist leadership but rather to explore possibilities of authoritarianist leadership fixing Indonesia's structural problems or rejecting authoritarianism on the basis of consistently putting the needs of the state above the many.
